import React, { Component } from "react";
import { 
  MDBNavbar, 
  MDBNavbarBrand, 
  MDBNavbarNav, 
  MDBNavItem, 
  MDBNavLink, 
  MDBNavbarToggler, 
  MDBCollapse, 
  MDBDropdown, 
  MDBDropdownToggle, 
  MDBDropdownMenu, 
  MDBDropdownItem, 
  MDBIcon, 
  MDBContainer,
  MDBRow,
  MDBCol
} from "mdbreact";
import { BrowserRouter as Router, Route} from 'react-router-dom'
import contenedor from "."
import "./index.css";

class App extends Component {
  handleTogglerClick = () => {
    this.setState({
      collapsed: !this.state.collapsed
    });
  }

  render() {
    return (
      <MDBContainer fluid>
        <MDBRow>
          <MDBCol size="8">

          </MDBCol>
          <MDBCol size="4">

          </MDBCol>
        </MDBRow>
      </MDBContainer>
    );
  }
}

export default App;
